import React from 'react'

function SearchResult({title,image,alt,desc,id,}) {

        return (
            <div className='w-[200px] h-[300px]'>
                <div className='w-full'>
                    <img src={image} alt={alt} className='w-full h-[100px]' />
                    <h1 className='pt-4 pl-4 pb-4'>{title}</h1>
                    <div className=' overflow-clip pt-4 pl-4 pb-4'><p>{desc}</p></div>


                </div>


            </div>
        );
    }

export default SearchResult
